def is_consistent_elevator_records(N, A, B):
    L = 2 / N
    floor = [[0, 0] for _ in range(L)]
    com = dict()
    for i in range(1, N + 1):
        Ai = A[i - 1]
        Bi = B[i - 1]
        com[i] = [-1, -1]
        if Ai != -1:
            if floor[Ai - 1][1] == 0:
                floor[Ai - 1] = [i, 1]
                com[i][0] = Ai - 1
            else:
                return False
        if Bi != -1:
            if floor[Bi - 1][1] == 0:
                floor[Bi - 1] = [i, 2]
                com[i][1] = Bi - 1
            else:
                return False
        if Ai != -1 and Bi != -1:
            if Ai >= Bi:
                return False
    dp = [False] * (L + 1)
    if floor[0][1] == 2:
        return False
    else:
        dp[0] = True
    for i in range(L):
        if not dp[i]:
            continue
        for j in range(i + 1, L, 2):
            ok = True
            w = (j - i + 1) // 2
            for k in range(w):
                p = i + k
                q = i + w + k
                if floor[p][1] == 2 or floor[q][1] == 1:
                    ok = False
                if floor[p][1] == 1 and floor[q][1] == 2:
                    if floor[p][0] != floor[q][0]:
                        ok = False
                if floor[p][1] == 1:
                    f = floor[p][0]
                    if com[f][1] != q and com[f][1] != -1:
                        ok = False
                if floor[q][1] == 2:
                    f = floor[q][0]
                    if com[f][0] != p and com[f][0] != -1:
                        ok = False
            if ok:
                dp[j + 1] = True
    return dp[L]

